import styled from 'styled-components';

export const CouponItemWrapper = styled.div`
  padding: 20px;
  border-radius: 15px;
  margin: 0px 15px 15px 0px;
  background: ${({ theme }) => theme.background.container};
  .txtTitle {
      font-size: 16px;
      font-weight: 300;
      padding-top: 20px;
      color: ${({ theme }) => theme.text.title};
    }
    .txtValue {
      font-size: 16px;
      font-weight: bold;
    }

  @media (max-width: 577px) {
  }
`;
